import * as actionTypes from './actionTypes'

export function getImage(images) {
    return { type: actionTypes.GET_IMAGE, payload: images }
}
export function displayImages() {
    return function(dispatch) {
        let url = "https://api.unsplash.com/search/photos?page=1&query=officeClientIdbf212ee9f25f55cf50152fab5d4ff2019342d0e1623f3c03b11806753d2dc599";
        return fetch(url)
            .then(response => response.json())
            .then(result => dispatch(getImage(result)))

    }
}
